import axios from 'axios'
import React from 'react'


function Home() {
  useEffect(()=>{
    axios.get('/')
    .then(res =>{
      console.log(res)
    })
    .catch(err=> console.log(err))
  })
  return (
    <div>
        <h1>Home</h1>
    </div>
  )
}

export default Home
